import { useState } from 'react';

function BuildingSearch() {
  const [filters, setFilters] = useState({
    location: '',
    priceRange: '',
    bedrooms: '',
    amenities: [],
  });

  // Mock data - replace with real API data
  const buildings = [
    {
      id: 1,
      name: "The University Commons",
      address: "123 College Ave",
      price: "$800/month",
      bedrooms: "2-4",
      amenities: ["Gym", "Pool", "Study Room"],
      image: "https://placeholder.com/300",
      rating: 4.5,
    },
    // Add more mock data
  ];

  return (
    <div className="pt-[72px]">
      {/* Search Header */}
      <div className="bg-gradient-to-br from-blue-600 via-blue-700 to-indigo-800 py-12">
        <div className="container mx-auto px-6">
          <h1 className="text-4xl font-bold text-white mb-6">Find Your Perfect Place</h1>

          {/* Filters */}
          <div className="bg-white/95 backdrop-blur-lg p-6 rounded-xl shadow-lg">
            <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
              <input
                type="text"
                placeholder="Location"
                className="p-3 border rounded-lg"
                value={filters.location}
                onChange={(e) => setFilters({...filters, location: e.target.value})}
              />
              <select 
                className="p-3 border rounded-lg"
                value={filters.priceRange}
                onChange={(e) => setFilters({...filters, priceRange: e.target.value})}
              >
                <option value="">Price Range</option>
                <option value="0-1000">$0 - $1000</option>
                <option value="1001-2000">$1001 - $2000</option>
                <option value="2001+">$2001+</option>
              </select>
              <select
                className="p-3 border rounded-lg"
                value={filters.bedrooms}
                onChange={(e) => setFilters({...filters, bedrooms: e.target.value})}
              >
                <option value="">Bedrooms</option>
                <option value="1">1 Bedroom</option>
                <option value="2">2 Bedrooms</option>
                <option value="3+">3+ Bedrooms</option>
              </select>
              <button className="bg-gradient-to-r from-blue-500 to-indigo-600 text-white p-3 rounded-lg font-semibold hover:from-blue-600 hover:to-indigo-700">
                Search
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Results Grid */}
      <div className="container mx-auto px-6 py-12">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {buildings.map((building) => (
            <div key={building.id} className="bg-white rounded-xl shadow-lg overflow-hidden hover:shadow-xl transition-shadow duration-300">
              <img src={building.image} alt={building.name} className="w-full h-48 object-cover" />
              <div className="p-6">
                <div className="flex justify-between items-start mb-2">
                  <h3 className="text-xl font-bold text-gray-800">{building.name}</h3>
                  <span className="bg-blue-50 text-blue-600 px-2 py-1 rounded-lg text-sm font-semibold">
                    {building.rating} ★
                  </span>
                </div>
                <p className="text-gray-600 mb-2">{building.address}</p>
                <p className="text-gray-800 font-semibold mb-4">{building.price}</p>
                <div className="flex flex-wrap gap-2 mb-4">
                  {building.amenities.map((amenity, index) => (
                    <span key={index} className="px-3 py-1 bg-blue-50 text-blue-600 rounded-full text-sm">
                      {amenity}
                    </span>
                  ))}
                </div>
                <button className="w-full bg-gradient-to-r from-blue-500 to-indigo-600 text-white py-2 rounded-lg font-semibold hover:from-blue-600 hover:to-indigo-700">
                  View Details
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default BuildingSearch;
